import React from "react";
import talent from "./talentshow.jpg";
import Jumbotron from "react-bootstrap/Jumbotron";
import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import CardDeck from "react-bootstrap/CardDeck";
import Maps from "./maps";

class Main extends React.Component {
  render() {
    return (
      <div>
        <Jumbotron>
          <h1>Welcome to Reality Ministries RideShare</h1>
          <p>
            This site allows volunteers to find members who need rides! Click below to view our website and learn about our mission.
          </p>
          <p>
            <Button
              variant="primary"
              href="http://www.realityministriesinc.org"
            >
              Learn more
            </Button>
          </p>
        </Jumbotron>
        <CardDeck>
          <Card style={{ width: "18rem" }}>
            <Card.Img variant="top" />
            <Card.Body>
              <Card.Title>Event Map</Card.Title>
              <Card.Text>
                <Maps />
              </Card.Text>
              <Button variant="primary">Go somewhere</Button>
            </Card.Body>
          </Card>
        </CardDeck>
      </div>
    );
  }
}
export default Main;
